    {
    }

    public function __invoke(): void
    {
        foreach ($this->getData() as $item) {
            $muscleGroup = $this->muscleGroupRepository->findOneBy(['name' => $item[0]]);
            $exerciseType = $this->exerciseTypeRepository->findOneBy(['name' => $item[1]]);
            $equipment = $this->equipmentRepository->findOneBy(['name' => $item[2]]);
            $workoutType = $this->workoutTypeRepository->findOneBy(['name' => $item[4]]);
            $object = $this->exerciseRepository->findOneBy([
                'name' => $item[3],
                'muscleGroup' => $muscleGroup,
                'exerciseType' => $exerciseType,
                'equipment' => $equipment,
                'workoutType' => $workoutType,
            ]);
            if ($object !== null) {
                continue;
            }

            $object = new Exercise($item[3]);
            $object->setMuscleGroup($muscleGroup);
            $object->setExerciseType($exerciseType);
            $object->setEquipment($equipment);
            $object->setWorkoutType($workoutType);
            $object->setPictureUrl($item[5]);
            $object->setVideoUrl($item[6]);

            $this->exerciseRepository->persist($object);
        }

        $this->exerciseRepository->flush();
    }

